private void parseStartTag() {
tq.consume("<");
String tagName = tq.consumeWord();

if (tagName.length() == 0) { // doesn't look like a start tag after all; put < back on stack and handle as text
tq.addFirst("&lt;");
parseTextNode();
return;
}

Attributes attributes = new Attributes();
while (!tq.matchesAny("<", "/>", ">") && !tq.isEmpty()) {
Attribute attribute = parseAttribute();
if (attribute != null)
attributes.put(attribute);
}

Tag tag = Tag.valueOf(tagName);
Element child = new Element(tag, baseUri, attributes);

boolean isEmptyElement = tag.isEmpty(); // empty element if empty tag (e.g. img) or self-closed el (<div/>
if (tq.matchChomp("/>")) { // close empty element or tag
isEmptyElement = true;
} else {
tq.matchChomp(">");
}
addChildToParent(child, isEmptyElement);

// pc data only tags (textarea, script): chomp to end tag, add content as text node
if (tag.isData()) {
String data = tq.chompTo("</" + tagName);
tq.chompTo(">");

Node dataNode;
if (tag.equals(titleTag) || tag.equals(textareaTag)) // want to show as text, but not contain inside tags (so not a data tag?)
dataNode = TextNode.createFromEncoded(data, baseUri);
else
dataNode = new DataNode(data, baseUri); // data not encoded but raw (for " in script)
child.appendChild(dataNode);
}

// <base href>: update the base uri
if (child.tagName().equals("base")) {
String href = child.absUrl("href");
if (href.length() != 0) { // ignore <base target> etc
baseUri = href;
doc.setBaseUri(href); // set on the doc so doc.createElement(Tag) will get updated base
}
}
}

boolean canContain(Tag child) {
Validate.notNull(child);

if (child.isBlock && !this.canContainBlock)
return false;

if (!child.isBlock && !this.canContainInline) // not block == inline
return false;

if (this.optionalClosing && this.equals(child))
return false;

if (this.empty || this.isData())
return false;

// head can only contain a few. if more than head in here, modify to have a list of valids
// TODO: (could solve this with walk for ancestor)
if (this.tagName.equals("head")) {
if (child.tagName.equals("base") || child.tagName.equals("script") || child.tagName.equals("noscript") || child.tagName.equals("link") ||
child.tagName.equals("meta") || child.tagName.equals("title") || child.tagName.equals("style") || child.tagName.equals("object")) {
return true;
}
return false;
}

// dt and dd (in dl)
if (this.tagName.equals("dt") && child.tagName.equals("dd"))
return false;
if (this.tagName.equals("dd") && child.tagName.equals("dt"))
return false;

return true;
}

private static final String SQ = "'";
private static final String DQ = "\"";

private static final Tag htmlTag = Tag.valueOf("html");
private static final Tag headTag = Tag.valueOf("head");
private static final Tag bodyTag = Tag.valueOf("body");
private static final Tag titleTag = Tag.valueOf("title");
private static final Tag textareaTag = Tag.valueOf("textarea");

private final LinkedList<Element> stack;
private final TokenQueue tq;
private final Document doc;
private String baseUri;

private Parser(String html, String baseUri, boolean isBodyFragment) {
Validate.notNull(html);
Validate.notNull(baseUri);

stack = new LinkedList<Element>();
tq = new TokenQueue(html);
this.baseUri = baseUri;

if (isBodyFragment) {
doc = Document.createShell(baseUri);
stack.add(doc.body());
} else {
doc = new Document(baseUri);
stack.add(doc);
}
}

private Elements select() {
tq.consumeWhitespace();

if (tq.matchesAny(combinators)) { // if starts with a combinator, use root as elements
elements.add(root);
combinator(tq.consume().toString());
} else {
addElements(findElements()); // chomp first element matcher off queue
}

while (!tq.isEmpty()) {
// hierarchy and extras
boolean seenWhite = tq.consumeWhitespace();

if (tq.matchChomp(",")) { // group or
while (!tq.isEmpty()) {
String subQuery = tq.chompTo(",");
elements.addAll(select(subQuery, root));
}
} else if (tq.matchesAny(combinators)) {
combinator(tq.consume().toString());
} else if (seenWhite) {
combinator(" ");
} else { // E.class, E#id, E[attr] etc. AND
Elements candidates = findElements(); // take next el, #. etc off queue
intersectElements(filterForSelf(elements, candidates));
}
}
return new Elements(elements);
}

private Element addChildToParent(Element child, boolean isEmptyElement) {
Element parent = popStackToSuitableContainer(child.tag());
Tag childTag = child.tag();
boolean validAncestor = stackHasValidParent(childTag);

if (!validAncestor) {
// create implicit parent around this child
Tag parentTag = childTag.getImplicitParent();
Element implicit = new Element(parentTag, baseUri);
// special case: make sure there's a head before putting in body
if (child.tag().equals(bodyTag)) {
Element head = new Element(headTag, baseUri);
implicit.appendChild(head);
}
implicit.appendChild(child);

// recurse to ensure somewhere to put parent
Element root = addChildToParent(implicit, false);
if (!isEmptyElement)
stack.addLast(child);
return root;
}

parent.appendChild(child);

if (!isEmptyElement)
stack.addLast(child);
return parent;
}

private Element popStackToClose(Tag tag) {
// first check to see if stack contains this tag; if so pop to there, otherwise ignore
int counter = 0;
Element elToClose = null;
for (int i = stack.size() -1; i > 0; i--) {
counter++;
Element el = stack.get(i);
Tag elTag = el.tag();
if (elTag.equals(bodyTag) || elTag.equals(htmlTag)) { // once in body, don't close past body
break;
} else if (elTag.equals(tag)) {
elToClose = el;
break;
}
}
if (elToClose != null) {
for (int i = 0; i < counter; i++) {
stack.removeLast();
}
}
return elToClose;
}

private Elements findElements() {
if (tq.matchChomp("#")) {
return byId();
} else if (tq.matchChomp(".")) {
return byClass();
} else if (tq.matchesWord()) {
return byTag();
} else if (tq.matchChomp("[")) {
return byAttribute();
} else if (tq.matchChomp("*")) {
return allElements();
} else if (tq.matchChomp(":lt(")) {
return indexLessThan();
} else if (tq.matchChomp(":gt(")) {
return indexGreaterThan();
} else if (tq.matchChomp(":eq(")) {
return indexEquals();
} else { // unhandled
throw new SelectorParseException("Could not parse query " + query);
}
}

private Document parse() {
while (!tq.isEmpty()) {
if (tq.matches("<!--")) {
parseComment();
} else if (tq.matches("<![CDATA[")) {
parseCdata();
} else if (tq.matches("<?") || tq.matches("<!")) {
parseXmlDecl();
} else if (tq.matches("</")) {
parseEndTag();
} else if (tq.matches("<")) {
parseStartTag();
} else {
parseTextNode();
}
}
return doc.normalise();
}

