void outerHtml(StringBuilder accum) {
if (isBlock() || (parent() != null && parent().tag().canContainBlock() && siblingIndex() == 0))
indent(accum);
accum
.append("<")
.append(tagName())
.append(attributes.html());

if (childNodes.isEmpty() && tag.isEmpty()) {
accum.append(" />");
} else {
accum.append(">");
html(accum);
if (tag.canContainBlock()) indent(accum);
accum.append("</").append(tagName()).append(">");
}
}

public Document normalise() {
if (select("html").isEmpty())
appendElement("html");
if (head() == null)
select("html").first().prependElement("head");
if (body() == null)
select("html").first().appendElement("body");

// pull text nodes out of root, html, and head els, and push into body. non-text nodes are already taken care
// of. do in inverse order to maintain text order.
normalise(head());
normalise(select("html").first());
normalise(this);

return this;
}

private Parser(String html, String baseUri, boolean isBodyFragment) {
