public boolean equals(Object o) {
if (this == o) return true;
if (o == null || getClass() != o.getClass()) return false;

Tag tag = (Tag) o;

if (canContainBlock != tag.canContainBlock) return false;
if (canContainInline != tag.canContainInline) return false;
if (empty != tag.empty) return false;
if (isBlock != tag.isBlock) return false;
if (optionalClosing != tag.optionalClosing) return false;
if (tagName != null ? !tagName.equals(tag.tagName) : tag.tagName != null) return false;

return true;
}

public boolean matches(String seq) {
int len = seq.length();
if (len > queue.size())
return false;
List<Character> chars = queue.subList(0, len);
char[] seqChars = seq.toCharArray();
for (int i = 0; i < len; i++) {
Character found = Character.toLowerCase(chars.get(i));
Character check = Character.toLowerCase(seqChars[i]);
if (!found.equals(check))
return false;
}
return true;
}

private boolean stackHasValidParent(Tag childTag) {
if (stack.size() == 1 && childTag.equals(htmlTag))
return true; // root is valid for html node

for (int i = stack.size() -1; i >= 0; i--) {
Element el = stack.get(i);
Tag parent2 = el.tag();
if (parent2.isValidParent(childTag)) {
return true;
}
}
return false;
}

